import React from "react";

const Slide = ({ content }) => {
    console.log(content);
  return (
    <div
      style={
        ({ height: "500px" },
        { width: "900px" },
        { backgroundImage: `url(${content})` },
        { backgroundSize: "cover" },
        { backgroundRepeat: "no-repeat" },
        { backgroundPosition: "center" })
      }
    ><img src={content} /></div>
  );
};

export default Slide;
